export default function FormInput() {
  return (
    <div>
      <form onSubmit={(e) => handleSubmit(e)}>
        <input
          onChange={(e) => setTodo(e.target.value)}
          value={todo}
          type="text"
        />
        <button type="submit">ADD</button>

        {todos.map((todo) => (
          <TodoList key={todo} item={todo} />
        ))}
      </form>
    </div>
  );
}
